Play the next generation of Endless Runner with a twist of RPG with INFINITE WARRIOR.

In the fantasy world of Infinite Warrior you fight an epic battle against an endless onslaught of bloodthirsty enemies.
Unleash Hell by performing swift, well-timed finger swipes at opponents and be rewarded with gold, loot and gritty over-the-top 3D animations recorded by Hollywood fight coordinators.
Wage War on 9 unique and visually breathtaking battlefields, in full 3d.

Use collected cash to purchase fantastic new weapons and hardy armor to both customize and improve your hero.
Level up your Warrior by completing over 100 quests and be rewarded with highly sought power gems to enchant your equipment pieces.

Call in fearsome dragons to trigger &quot;Head-Start&quot; power-up and find ways to boost your score and best your friends on four different leaderboards while striving to become the ultimate Infinite Warrior!

